import React from 'react'
import { Formik, Form } from 'formik';
import { TextField } from './TextField';

export const Login = () => {
    return (
        <Formik
        initialValues={{
            email: '',
            password: '',  
            }}
        >

            {formik => (
            <div>
            {console.log(formik)}
            <Form>
                <TextField name="email" type="email" placeholder="E-mail"/>
                <TextField name="password" type="password" placeholder="Senha"/>
            </Form>
            </div>    
            )}
        </Formik>
    )
}
